          {"8f31e270-c431-4ef9-a3eb-f1f3284266fa":{"defs":[],"roots":{"references":[{"attributes":{},"id":"1316","type":"AllLabels"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{"callback":null},"id":"1020","type":"TapTool"},{"attributes":{"child":{"id":"1003"},"title":"Worker Profile (compute)"},"id":"1403","type":"Panel"},{"attributes":{"tools":[{"id":"1020"},{"id":"1021"},{"id":"1022"},{"id":"1023"},{"id":"1036"}]},"id":"1025","type":"Toolbar"},{"attributes":{},"id":"1435","type":"BasicTickFormatter"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"below":[{"id":"1259"}],"center":[{"id":"1262"},{"id":"1266"},{"id":"1280"}],"height":150,"left":[{"id":"1263"}],"renderers":[{"id":"1278"}],"sizing_mode":"stretch_both","title":{"id":"1250"},"toolbar":{"id":"1270"},"toolbar_location":"above","x_range":{"id":"1215"},"x_scale":{"id":"1255"},"y_range":{"id":"1253"},"y_scale":{"id":"1257"}},"id":"1249","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1497","type":"UnionRenderers"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 38.85 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 5 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 4.70 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 2.41 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.4.218:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 384 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr, timeout=60, heartbeat_interval=10)\n    return client\n\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n# Get client\nclient = connect(scheduler_info)\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    # Construct a lazy task graph \n    print(\"gt array\", gt, flush=True)\n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt)\n    print(\"result \", client.compute(s).result(), flush=True)       \n\nprint(\"Done in \", time.time() - t, flush=True)\nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1436","type":"AllLabels"},{"attributes":{},"id":"1234","type":"ResetTool"},{"attributes":{},"id":"1498","type":"Selection"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"axis":{"id":"1230"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1233","type":"Grid"},{"attributes":{},"id":"1438","type":"BasicTickFormatter"},{"attributes":{"axis":{"id":"1016"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1019","type":"Grid"},{"attributes":{"coordinates":null,"formatter":{"id":"1444"},"group":null,"major_label_policy":{"id":"1445"},"ticker":{"id":"1049"},"visible":false},"id":"1048","type":"LinearAxis"},{"attributes":{"tabs":[{"id":"1402"},{"id":"1406"},{"id":"1409"},{"id":"1410"},{"id":"1403"},{"id":"1404"},{"id":"1405"},{"id":"1407"},{"id":"1408"}]},"id":"1411","type":"Tabs"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{},"id":"1439","type":"AllLabels"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1512"},{"id":"1513"},{"id":"1514"},{"id":"1515"},{"id":"1516"},{"id":"1517"},{"id":"1518"},{"id":"1519"},{"id":"1520"},{"id":"1521"},{"id":"1522"},{"id":"1523"}]},"id":"1227","type":"DatetimeTicker"},{"attributes":{"overlay":{"id":"1024"}},"id":"1021","type":"BoxZoomTool"},{"attributes":{"dimensions":"width"},"id":"1235","type":"PanTool"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"blue"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"blue"},"height":{"value":0.9},"line_alpha":{"value":0.2},"line_color":{"value"
